$(document).on("carbonFields.apiLoaded",function(e,api){$(document).on("carbonFields.validateField",function(e,fieldName,error){if("listing_field_meta_key"===fieldName&&pno_listing_cf.is_default){if((value=api.getFieldValue(fieldName))!==pno_listing_cf.field_id)return pno_listing_cf.messages.no_meta_key_changes}else if("listing_field_meta_key"===fieldName&&!pno_listing_cf.is_default){var value=api.getFieldValue(fieldName);if(-1!==$.inArray(value,pno_listing_cf.restricted_keys))return pno_listing_cf.messages.reserved_key}if("listing_field_type"===fieldName&&pno_listing_cf.is_default&&(value=api.getFieldValue(fieldName))!==pno_listing_cf.field_type)return pno_listing_cf.messages.no_type_changes;return error})});